import React from "react";
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";

const ImageCarousel = () => {
  const imageStyle = {
    maxWidth: "100px", // Ajusta el tamaño máximo de las imágenes
    height: "auto", // Mantiene la proporción de aspecto de la imagen
  };

  return (
    <Carousel autoPlay={true} interval={3000} showStatus={false} showThumbs={false}>
      <div>
        <img src="/imagenpi.png" alt="Proyecto Individual" style={imageStyle} />
      </div>
      <div>
        <img src="/pf2.png" alt="Proyecto Grupal 1" style={imageStyle} />
        <img src="/pf3.png" alt="Proyecto Grupal 2" style={imageStyle} />
        <img src="/pf4.png" alt="Proyecto Grupal 3" style={imageStyle} />
        <img src="/pf5.png" alt="Proyecto Grupal 4" style={imageStyle} />
      </div>
    </Carousel>
  );
};

export default ImageCarousel;
